def count_vowels_and_consonants(input_string):
    vowels = "aeiouAEIOU"
    consonants = 0
    vowels_count = 0

    for char in input_string:
        if char.isalpha():
            if char in vowels:
                vowels_count += 1
            else:
                consonants += 1

    return vowels_count, consonants

